import { Overlay, Container } from './styles';

export default function Modal() {
  return (
    <Overlay>
      <Container>
        <h1>Title</h1>

        <p>Corpo</p>

        <Footer>Test</Footer>
      </Container>
    </Overlay>
  );
}
